import { Spinner } from '@chakra-ui/react';
import React from 'react';
import {
	InteractiveForceGraph,
	ForceGraphNode,
	ForceGraphLink,
} from 'react-vis-force';
// data structure definitions for NodeGraph component
interface links {
	source: string;
	target: string;
}
interface nodes {
	id: string;
}
interface nodeGraphDataStruct {
	nodes: nodes[];
	links: links[];
}

function SocialNodeGraph({
	nodeGraphData,
}: {
	nodeGraphData: nodeGraphDataStruct;
}) {
	return (
		<InteractiveForceGraph
			simulationOptions={{ height: 300, width: 300 }}
			labelAttr="label"
			onSelectNode={(node) => console.log(node)}
			highlightDependencies
		>
			<ForceGraphNode
				node={{ id: 'first-node', label: 'First node' }}
				fill="red"
			/>
			<ForceGraphNode
				node={{ id: 'second-node', label: 'Second node' }}
				fill="blue"
			/>
			<ForceGraphLink strokeWidth = "30"link={{ source: 'first-node', target: 'second-node' }} />
		</InteractiveForceGraph>
	);
}
export default SocialNodeGraph;
